/* @flow */
import BN from 'bn.js';
import {
  type Attribute,
  type Witness,
  CONTRACT_PARAMETER_TYPE,
  CONTRACT_PROPERTY_STATE,
  Contract,
  InvocationTransaction,
  Input,
  Output,
  common,
  utils,
  BufferAttribute,
} from '@neo-one/client-core';

import keys from './keys';

export const createInvocation = ({
  script,
  gas,
  attributes,
  inputs,
  outputs,
  scripts,
}: {|
  script: Buffer,
  gas?: BN,
  attributes?: Array<Attribute>,
  inputs?: Array<Input>,
  outputs?: Array<Output>,
  scripts?: Array<Witness>,
|}) =>
  new InvocationTransaction({
    script,
    gas: gas || utils.ZERO,
    attributes,
    inputs,
    outputs,
    scripts,
  });

const kycContractScript = Buffer.from(
  '',
  'hex',
);
export const kycContract = new Contract({
  script: kycContractScript,
  parameterList: [
    CONTRACT_PARAMETER_TYPE.STRING,
    CONTRACT_PARAMETER_TYPE.ARRAY,
  ],
  returnType: CONTRACT_PARAMETER_TYPE.VOID,
  name: '',
  codeVersion: '',
  author: '',
  email: '',
  description: '',
  contractProperties: CONTRACT_PROPERTY_STATE.HAS_STORAGE,
});
export const kycTransaction = new InvocationTransaction({
  script: Buffer.from(
    '',
    'hex',
  ),
  gas: utils.ZERO,
});
export const mintTransaction = new InvocationTransaction({
  script: Buffer.from(
    '00c10a6d696e74546f6b656e7367dc6cc7701762e83d2d3795d27b1aac14469e5734',
    'hex',
  ),
  gas: utils.ZERO,
  inputs: [
    new Input({
      hash: common.bufferToUInt256(Buffer.alloc(32, 0)),
      index: 0,
    }),
  ],
  outputs: [
    new Output({
      value: new BN(54).mul(utils.ONE_HUNDRED_MILLION),
      asset: common.stringToUInt256(common.NEO_ASSET_HASH),
      address: kycContract.hash,
    }),
    new Output({
      value: new BN(150).mul(utils.ONE_HUNDRED_MILLION),
      asset: common.stringToUInt256(common.NEO_ASSET_HASH),
      address: keys[0].scriptHash,
    }),
  ],
  attributes: [
    new BufferAttribute({
      usage: 0x81,
      value: Buffer.alloc(32, 0),
    }),
  ],
});

